import React from 'react'
import { useState } from 'react';

const SignupForm = () => {
    const [formData, setFormData] = useState({
        username: '',
        email: '',
        password: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Handle form submission logic here
        console.log(formData);
    };

    const formStyle = {
        color: 'white',
        backgroundColor: 'black',
        padding: '20px',
        borderRadius: '5px'
    };

    const inputStyle = {
        color: 'black',
        backgroundColor: 'white',
        margin: '10px 0',
        padding: '10px',
        borderRadius: '5px',
        border: 'none'
    };

    const buttonStyle = {
        color: 'black',
        backgroundColor: 'white',
        padding: '10px 20px',
        borderRadius: '5px',
        border: 'none',
        cursor: 'pointer'
    };

    return (
        <form onSubmit={handleSubmit} style={formStyle}>
            <div>
                <label>Username:</label>
                <input type="text" name="username" value={formData.username} onChange={handleChange} style={inputStyle} />
            </div>
            <div>
                <label>Email:</label>
                <input type="email" name="email" value={formData.email} onChange={handleChange} style={inputStyle} />
            </div>
            <div>
                <label>Password:</label>
                <input type="password" name="password" value={formData.password} onChange={handleChange} style={inputStyle} />
            </div>
            <button type="submit" style={buttonStyle}>Signup</button>
        </form>
    );
};

export const Signup = () => {
    return (
        <div>
            <h2 style={{ color: 'white' }}>Signup</h2>
            <SignupForm />
        </div>
    );
};

export default Signup;
